import Table from "react-bootstrap/Table";
import { useSelector } from "react-redux";

function ImagenList() {
  //const dispatch = useDispatch()

  const data = useSelector();

  console.log(data);
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>id</th>
          <th>Imagem</th>
          <th>Usuario</th>
        </tr>
      </thead>
      {data.map((item) => (
        <tbody key={item.imagem.id}>
          <tr>
            <td>{item.imagem.id}</td>
            <td>{JSON.stringify(item.imagem.url)}</td>
            <td>{item.imagem.user_id}</td>
          </tr>
        </tbody>
      ))}
    </Table>
  );
}

export default ImagenList;
